import Link from "next/link"

const Post = () => {
  return (
    <div>
      <h1>New Post</h1>
      <p>
        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Eveniet, quae?
      </p>
      <Link href="/">
          <a>Back to home</a>
        </Link>
    </div>
  );
};

export default Post;
